function run(resposta) {
    const repositories = JSON.parse(resposta);
    const events = [];

    const cSharpRepos = repositories
        .filter(repo => repo.language === "C#")
        .sort((a, b) => new Date(a.createdAt) - new Date(b.createdAt))
        .slice(0, 5);

    cSharpRepos.forEach(repo => {
        events.push({
            "header": {
                "type": "application/vnd.lime.media-link+json",
                "value": {
                    "title": repo.fullName,
                    "text": repo.description,
                    "type": "image/jpeg",
                    "uri": "https://avatars.githubusercontent.com/u/4369522?s=200&v=4",
                    "aspectRatio": "1:1"
                }
            }
        });
    });

    return {
        "itemType": "application/vnd.lime.document-select+json",
        "items": events
    };
}
